import React, {useState} from "react";
import { useHttp } from "../hooks/http.hook";

export const MainPage = () =>{
    const {request} = useHttp();

    const [id, setId] = useState({id:''});

    const ff = async(event) => {
        await setId({id:event.target.value});
        getData();
        alert(id.id);
    }

    const getData = async () => {
        try
        {
            const data = await request('/api', 'POST', {...id});
            alert(id.id);
            console.log('Data', data);
        }
        catch(error){}
    }

    return(
        <div>
            <h1>MainPage</h1>
            <input type = 'text' onChange={ff}/>
            <button value='111' onClick = {ff}>101</button>
            <button onClick = {getData}>102</button>
        </div>
    )
}
